import React, { Component } from 'react';
import './NavigationMenu.css';
import Link  from "react-router-dom";

interface MenuProps {
    links : Link[];
    logo : string;
};

interface Link {
    label : string;
    link : string;
    active? : boolean;
};

interface MenuState {
    showForm : boolean;
};

class NavigationMenu extends Component<MenuProps, MenuState> {
    constructor(props : any) {
        super(props);

        this.state = {
            showForm: false
        };
    }

    showForm() {
        this.setState({
            showForm: !this.state.showForm
        });
    }

    render() {


        let linksMarkup = this.props.links.map((link, index) => {
            let linkMarkup = link.active ? (
                <a className="menu__link menu__link--active" href={link.link}>{link.label}</a>
            ) : (
                <a className="menu__link" href={link.link}>{link.label}</a>
            );

            return (
                <li key={index} className="menu__list-item">
                    {linkMarkup}
                </li>
            );
        });

        return (

            <nav className="menu">
                <h1 style={{
                backgroundImage: 'url(' + this.props.logo + ')'
                }} className="menu__logo"></h1>


                <div className="menu__right">

                <h1>Purrfect Match </h1>



                    <ul className="menu__list">
                        {linksMarkup}
                    </ul>


                </div>
            </nav>
        );
    }
}

export default NavigationMenu;
